function Modal(props){
    function cancelModel(){
        props.onCancel();
    }

    function cancelConfirm(){
        props.onConfirm()
    }
    return(
        <div className = "modal">
            <p>Are you sure?</p>
            <button className="btn btn--alt" onClick = {cancelModel}>Cancel</button>
            <button className="btn" onClick={cancelConfirm}>Confirm</button>
        </div>
    )

}

export default Modal;
